/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-FilePatchListView:empty:before {
  content: 'No changes';
  display: block;
  padding: 10px;
  text-align: center;
  color: rgba(159, 165, 177, 0.6);
  font-style: italic;
}
.github-FilePatchListView-item {
  position: relative;
  display: flex;
  align-items: flex-start;
  padding: 5px 10px;
  padding-left: 35px;
  overflow: hidden;
  -webkit-user-select: none;
  cursor: default;
}
.github-FilePatchListView-icon {
  text-align: right;
}
.github-FilePatchListView-icon:before {
  margin-right: 8.33333333px;
}
.github-FilePatchListView-path {
  flex: 1;
  word-break: break-word;
}
.github-FilePatchListView-resolutionItem {
  padding-top: 0;
  padding-bottom: 5px;
}
.github-MergeConflictPaths .github-FilePatchListView-icon:last-child {
  margin-left: 5px;
}
